patch:
diff --git a/sapi/phpdbg/phpdbg_watch.c b/sapi/phpdbg/phpdbg_watch.c
index 0468d4614fd..50c07210e27 100644
--- a/sapi/phpdbg/phpdbg_watch.c
+++ b/sapi/phpdbg/phpdbg_watch.c
@@ -968,7 +968,11 @@ void phpdbg_remove_watchpoint(phpdbg_watchpoint_t *watch) {
 	efree(watch);
 }

-void phpdbg_clean_watch_element(phpdbg_watch_element *element) {
+// FIXME: Crash CWE-824: Access of Uninitialized Pointer
+ void phpdbg_clean_watch_element(phpdbg_watch_element *element) {
+	if (!element || !element->watch) {
+		return;
+	}
 	HashTable *elements = &element->watch->elements;
 	phpdbg_unwatch_parent_ht(element);
 	zend_hash_del(elements, element->str);
